tables.table_schema:
CREATE TABLE visa_information ( 
    visa_id INT PRIMARY KEY, 
    user_id INT, 
    visa_type VARCHAR(50), 
    expiration_date DATE 
);

CREATE TABLE user_details ( 
    user_id INT PRIMARY KEY, 
    full_name VARCHAR(100), 
    date_of_birth DATE, 
    nationality VARCHAR(50) 
);
